import logo from './logo.svg';
import './App.css';
import Header from './Component/Header/Header';
import Sidebar from './Component/Sidebar/Sidebar';
import Filter from './Component/Filter/Filter';

function App() {
  return (
    <div className="App">
     <Header />

     <div className='main__display'>
     <Sidebar />
     <Filter />
     </div>
    </div>
  );
}

export default App;
